import {
  Scene,
  Color,
  OrthographicCamera,
  ShaderMaterial,
  PlaneGeometry,
  Mesh,
} from "three";
let transition = `data:image/png;base64,`
/**
 * @class TransitionScene
 * @classdesc 场景切换过度类
 * @constructor
 * @param {Scene} scenMain 开始场景
 * @param {Object} [options] 配置参数
 * @param {Number} options.transition=0 过渡进程，从0-1
 * @param {string} options.texture 指定过渡纹理
 * @param {Boolean} options.useTexture=false 是否使用纹理
 * @param {Number} options.transitionSpeed=0.05 过渡速度
 * @param {Boolean} options.animate=false 是否开始动画
 */
class TransitionScene {
  constructor(scenMain, options = {}) {
    // 过渡的参数
    let {
      transition = 0,
      texture = transition,
      useTexture = false,
      transitionSpeed = 0.05,
      animate = false,
    } = options;
    this.transition = transition;
    this.texture = texture;
    this.useTexture = useTexture;
    this.transitionSpeed = transitionSpeed;
    this.animate = animate;
    this.renderer = scenMain.renderer;

    this.initScene(
      scenMain.renderer.domElement.offsetWidth,
      scenMain.renderer.domElement.offsetHeight,
    );

    // 过渡开始前的场景
    this.sceneFrom = scenMain.scene;
    // 过渡结束后的场景
    this.sceneTo = undefined;

    // 切换下一个场景
    this.update = (sceneTo, params = {}) => {
      // 动画正在执行中
      if (this.animate) return false;
      const { transitionSpeed = 0.05 } = params;
      this.sceneTo = sceneTo;
      this.transition = 0;
      this.transitionSpeed = transitionSpeed;
      this.animate = true;
      this.material.uniforms.tDiffuse1.value = this.sceneTo.fbo.texture;
      this.material.uniforms.tDiffuse2.value = this.sceneFrom.fbo.texture;
      this.material.uniforms.threshold.value = 0.1;
      this.material.uniforms.mixRatio.value = 0.0;
      return true;
    };
    // 所有的场景渲染
    this.render = () => {
      if (this.transition === 0) {
        isDef(this.sceneFrom) && this.sceneFrom.render();
      } else if (this.transition >= 1) {
        isDef(this.sceneTo) && this.sceneTo.render();
        this.animate = false;
      } else {
        isDef(this.sceneFrom) && this.sceneFrom.render(true);
        isDef(this.sceneTo) && this.sceneTo.render(true);
        this.renderer.setRenderTarget(null);
        this.renderer.clear();
        this.renderer.render(this.scene, this.camera);
      }
      if (this.sceneTo&&this.animate && this.transition <= 1) {
        // 动画还在执行过程中
        this.transition = this.transition + this.transitionSpeed;
        this.material.uniforms.mixRatio.value = this.transition;
        this.material.uniforms.tDiffuse1.value = this.sceneTo.fbo.texture;
        this.material.uniforms.tDiffuse2.value = this.sceneFrom.fbo.texture;
      }

      if (this.transition >= 1) {
        // 切换完成

        setTimeout(() => {
          this.sceneFrom = this.sceneTo;
          this.transition = 0;
        }, 1000);
      }
    };
  }
}
/**
 * 初始化过度场景
 * @param {Object} params
 * @param {String} width 场景宽度
 * @param {String} height 场景高度
 * @param {String} fov 相机垂直视野角度
 *
 */
TransitionScene.prototype.initScene = function (params = {}) {
  let {
    width = window.innerWidth,
    height = window.innerHeight,
  } = params;
  this.scene = new Scene();
  this.scene.background = new Color(0xffffff);
  this.camera = new OrthographicCamera(width / -2, width / 2, height / 2, height / -2, -10, 10);
  this.material = new ShaderMaterial({
    uniforms: {
      tDiffuse1: {
        value: null,
      },
      tDiffuse2: {
        value: null,
      },
      mixRatio: {
        value: 0.0,
      },
      threshold: {
        value: 0.1,
      },
      useTexture: {
        value: false,
      },
      tMixTexture: {
        value: this.texture,
      },
    },
    vertexShader: `
      varying vec2 vUv;
      void main() {
        vUv = vec2( uv.x, uv.y );
        gl_Position = projectionMatrix * modelViewMatrix * vec4( position, 1.0 );
      }
    `,
    fragmentShader: `
      uniform float mixRatio;
      uniform sampler2D tDiffuse1;
      uniform sampler2D tDiffuse2;
      uniform sampler2D tMixTexture;
      uniform bool useTexture;
      uniform float threshold;
      varying vec2 vUv;
      void main() {
        vec4 texel1 = texture2D( tDiffuse1, vUv );
        vec4 texel2 = texture2D( tDiffuse2, vUv );
        if (useTexture==true) {
          vec4 transitionTexel = texture2D( tMixTexture, vUv );
          float r = mixRatio * (1.0 + threshold * 2.0) - threshold;
          float mixf=clamp((transitionTexel.r - r)*(1.0/threshold), 0.0, 1.0);
          gl_FragColor = mix( texel1, texel2, mixf );
        } else {
          gl_FragColor = mix( texel2, texel1, mixRatio );
        }
      }
    `,
  });

  const geometry = new PlaneGeometry(width, height);
  this.quad = new Mesh(geometry, this.material);
  this.scene.add(this.quad);
};

export default TransitionScene;
function isDef(v) {
  return v !== undefined && v !== null;
}
